import { Button, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from "@mui/material";
import { Alert, Col, Container, Row } from "react-bootstrap";
import { useSelector } from "react-redux";
import { useNavigate } from "react-router";
import { getSchoolData } from "./ApiServices";
import { useEffect, useState } from "react";

export function StudentList() {
    const[data,setdata] =useState([]);
    const isLogeddin = useSelector((state) => state.schoolData.isLogeddin);
    const navigate = useNavigate();
    const handleFetchData =async ()=>{
        const response = await getSchoolData();
        console.log(response);
        setdata(response);

    }
    useEffect(()=>{
        handleFetchData();
    },[])
    return (
        <>
            <div>
                {isLogeddin ? (
                    <Container className="mt-5">
                        <Row>
                            <Col lg={2}></Col>
                            <Col lg={8}>
                                <Alert className="text-center"><h3>Student-List</h3></Alert>
                                <TableContainer component={Paper}>
                                    <Table sx={{ minWidth: 650 }} aria-label="simple table">
                                        <TableHead>
                                            <TableRow>
                                                <TableCell style={{ fontSize: "large", color: "black" }}>S.N</TableCell>
                                                <TableCell style={{ fontSize: "large", color: "black" }}>Name</TableCell>
                                                <TableCell style={{ fontSize: "large", color: "black" }}>Roll Number</TableCell>
                                                <TableCell style={{ fontSize: "large", color: "black" }}>Section</TableCell>
                                                <TableCell align="center" style={{ fontSize: "large", color: "black" }}>Class</TableCell>
                                                <TableCell align="center" style={{ fontSize: "large", color: "black" }}>Number</TableCell>
                                                <TableCell align="center" style={{ fontSize: "large", color: "black" }}>Delete</TableCell>
                                            </TableRow>
                                        </TableHead>
                                        <TableBody>
                                            {data.map((data, index) => (
                                                <TableRow sx={{ '&:last-child td, &:last-child th': { border: 0 } }}>
                                                    <TableCell component="th" scope="row" style={{ fontSize: "16px", color: "black" }}>{index + 1}.</TableCell>
                                                    <TableCell component="th" scope="row" style={{ fontSize: "16px", color: "black" }}>{data.name}</TableCell>
                                                    <TableCell align="center" className="ms-2" style={{ fontSize: "16px", color: "black" }}>{data.rollnumber}</TableCell>
                                                    <TableCell align="center" className="ms-2" style={{ fontSize: "16px", color: "black" }}>{data.section}</TableCell>
                                                    <TableCell align="center" className="ms-2" style={{ fontSize: "16px", color: "black" }}>{data.class}</TableCell>
                                                    <TableCell align="center" className="ms-2" style={{ fontSize: "16px", color: "black" }}>{data.number}</TableCell>
                                                    {/* <TableCell align="center" className="ms-2"><Button variant="contained" onClick={(index) => handleDelete(data)} >View</Button></TableCell> */}
                                                </TableRow>


                                            ))

                                            }
                                        </TableBody>
                                    </Table>
                                </TableContainer>
                            </Col>
                            <Col lg={2}></Col>
                        </Row>

                    </Container>
                ) : (
                    <div className="mt-5">
                        <h4 className="text-center mt-5">Plese Login</h4>
                        <div className="text-center"><Button variant="outlined" onClick={() => navigate("/login")}>Login</Button></div>
                    </div>
                )

                }

            </div>

        </>
    )
}
